import React from 'react';

const ReportsPage = () => {
    return (
        <div style={{ padding: "2rem" }}>
            <h1 style={{ fontSize: "24px", fontWeight: "bold", marginBottom: "1rem" }}>Reports & Analytics</h1>
            <p>System reports and analytics dashboard.</p>
        </div>
    );
};

export default ReportsPage;
